import React from 'react';
import styled from 'styled-components';
import {setFlex, elevation, demotion, colors} from '../../utilities';

const Inflables = ({className}) => {
  return (
    <div className={className}>
      <h3>Juegos Inflables</h3>
    </div>
  );
}

const SlideInflables = styled(Inflables)`

  background-image: linear-gradient(to right, ${colors.purple}, ${colors.blue_2});
  ${setFlex()};
  color: white;
  width: 98%;
  height: 65vh;
  font-size: 4rem;
  margin: 1rem auto;
  border-radius: .7rem;
  ${elevation[5]};  
`;

export default SlideInflables;
